insert  into `syscontent`(`id`,`ctype`,`content`,`create_time`) values ('402883f5496f163301496f1fafca0002','7','&ldquo;健康护照&rdquo;APP是由爱奥乐医疗器械（深圳）有限公司倾力打造，旨在把爱奥乐医疗器械产品（血压计、血糖仪、体温计、体重体脂秤等）通过云服务平台，让用户随时随地可进行在线监测和测量结果查询的移动医疗健康APP。<br />\r\n<br />\r\n&ldquo;健康护照&rdquo;对用户的测量结果进行采集、存储、分析，所有数据同步至云端，形成健康档案，自动生成趋势图表，真实反映测量记录，使用户的测量数据通过授权，让亲人、医生、朋友远程查询测量报告，实现&ldquo;硬件+服务&rdquo;的完美结合。','2014-11-02 14:09:47'),('402883f5496f163301496f1fd68e0003','8','&nbsp;本服务协议双方为爱奥乐医疗器械（深圳）有限公司（甲方）与&ldquo;健康护照&rdquo;APP客户端用户（乙方），协议具有合同效力。<br />\r\n&ldquo;健康护照&rdquo;APP客户端为爱奥乐医疗器械（深圳）有限公司名下产品。<br />\r\n本服务协议内容包括正文及甲方已经发布或将来可能发布的所有规则。所有规则作为本服务协议不可分割的一部分，与协议正文具有同等的法律效力。<br />\r\n甲方保留对本服务协议不定时修改的权利，且拥有协议的最终解释权。<br />\r\n<br />\r\n<strong>隐私声明</strong><br />\r\n乙方在注册&ldquo;健康护照&rdquo;APP时，根据网站或客户端的要求提供个人信息。服务器会自动接收并记录乙方的个人信息。<br />\r\n甲方承诺不向任何人泄露乙方个人信息，除非:<br />\r\n1.事先得到乙方的许可；<br />\r\n2.根据相关法律规定，应行政机关或司法机关披露；<br />\r\n3.乙方出现违反中国相关法律或者网站政策的情况，需要向第三方披露；<br />\r\n4.属于其他本网站根据法律或者网站政策认为合适的披露情形。<br />\r\n乙方注册成功后，须妥善保管账号和密码，因为乙方个人原因导致信息泄露而造成的任何损失由乙方自行承担。<br />\r\n乙方须确保注册时所提供的信息真实，完整，不得冒用他人名义，或以他人身份信息进行账号注册，由此给他人造成的损失由乙方承担责任。<br />\r\n<br />\r\n<strong>趋势分析、建议等条款</strong><br />\r\n&ldquo;健康护照&rdquo;APP客户端所提供的信息仅供乙方参考，乙方进行自我评估后，对信息内容理解有误，而对自身病症判断错误，由乙方自行承担后果；&ldquo;健康护照&rdquo;APP所提供的测量、存储、分析数据均由先进的健康管理技术后整理设计的。<br />\r\n&ldquo;健康护照&rdquo;APP所提供的任何评估、建议，仅供参考，不能代替医生和和其他医务人员的建议。如自行使用本客户端资料发生偏差，甲方概不负责，亦不负任何法律责任。<br />\r\n<br />\r\n<strong>咨询、分享等服务条款</strong><br />\r\n&ldquo;健康护照&rdquo;APP客户端现有或今后推出的一键分享、转发、在线医生问诊等功能（以下称为&ldquo;咨询、分享&rdquo;），乙方选择使用此功能则意味着您自愿接受以下条款。<br />\r\n由于医疗行业的特殊性，问诊咨询服务的发起基于乙方主观的描述，医生尽可能利用医学知识及临床经验进行解答或就医方面的建议，不保证乙方一定能获得满足乙方要求的诊断、治疗方面的建议，也不能保证每次咨询一定能达到乙方的预期目的。<br />\r\n问诊咨询中医生回答的所有内容均属医生的个人建议，由于受不能面诊和检查等条件的限制，问诊咨询内容不能作为诊断、治疗的直接医疗处置，具体诊疗请一定到正规医院在专业医生指导下进行。乙方擅自将医生建议作为处方使用的，甲方及医生不承担任何责任。<br />\r\n由于乙方在问诊过程中提供的病情信息有误，而致使医生做出错误诊断，应由乙方自行承担后果。<br />\r\n医生言论仅代表其个人观点，不代表甲方同意其说法，甲方不承担由此引起的法律责任。<br />\r\n乙方使用&ldquo;健康护照&rdquo;APP的问诊咨询服务时，如乙方选择了付费问诊（包括向指定医生进行付费的问诊）。软件系统会提示并请乙方确认支付信息，乙方确认后视为接受此咨询服务的价格，及后续的支付流程。如果支付过程中因乙方的网络问题或账户安全问题所造成的财产损失，甲方概不负责。<br />\r\n乙方在使用问诊咨询服务时所提供的病情信息必须真实，如网站认为患者提供的信息存在虚构，或带有威胁、淫秽、谩骂、色情、暴力等内容，网站有权进行编辑、删除，直至暂停该用户使用资格，并保留追究法律责任的权利。<br />\r\n乙方在分享或转发相关数据时，引起的亲人、医生、朋友等人的回复，甲方不负责回复内容的准确性和可靠性。乙在听取后，造成的任何损失，均由乙方负责。<br />\r\n<br />\r\n版权声明：<br />\r\n爱奥乐医疗器械（深圳）有限公司享有&ldquo;健康护照&rdquo;APP客户端产品中的图标设计、界面设计和程序源代码、数据结构的全部版权。未经甲方授权，任何机构和个人无权使用爱奥乐医疗器械（深圳）有限公司的版权内容。<br />\r\n&ldquo;健康护照&rdquo;APP客户端产品在运营过程中由用户和亲人、医生、朋友等产生的文字、图片等内容信息的版权归爱奥乐医疗器械（深圳）有限公司享有；甲方可以在不通知用户和医生的前提下，重复使用上述信息；在使用这些信息的过程中，甲方保证用户的隐私数据安全。&nbsp;','2014-11-02 14:09:57'),('f9aa885b496f3add01497f4b308e0000','10','<h1><strong>X-Care terms of service</strong></h1>\r\n\r\n<h2>Welcome to X-Care</h2>\r\nThanks for using our products and services (&ldquo;Services&rdquo;). The Services are provided by Bioland Technology Ltd. (&ldquo;Bioland&rdquo;).<br />\r\nBy using our Services, you are agreeing to these terms.\r\n<h2>Using our Services</h2>\r\nYou must follow any policies made available to you within the Services.<br />\r\nDon&rsquo;t misuse our Services.<br />\r\nUsing our Services does not give you ownership of any intellectual property rights in our Services or the content you access. Our Services display some content that is not Bioland&rsquo;s., that does not necessarily mean that we review content, so please don&rsquo;t assume that we do.<br />\r\nIn connection with your use of the Services, we may send you service announcements, administrative messages, and other information. You may opt out of some of those communications.<br />\r\nSome of our Services are available on mobile devices. Do not use such Services in a way that distracts you and prevents you from obeying traffic or safety laws.\r\n<h2>Your X-Care Account</h2>\r\nYou may need a X-Care Account in order to use some of our Services.<br />\r\nTo protect your X-Care Account, keep your password confidential. You are responsible for the activity that happens on or through your X-Care Account. Try not to reuse your X-Care Account password on third-party applications.\r\n<h2>Modifying and Terminating our Services</h2>\r\nWe are constantly changing and improving our Services. We may add or remove functionalities or features, and we may suspend or stop a Service altogether.<br />\r\nYou can stop using our Services at any time, although we&rsquo;ll be sorry to see you go. Bioland may also stop providing Services to you, or add or create new limits to our Services at any time.\r\n<h2>Our Warranties and Disclaimers</h2>\r\nWe provide our Services using a commercially reasonable level of skill and care and we hope that you will enjoy using them. But there are certain things that we don&rsquo;t promise about our Services.<br />\r\nOTHER THAN AS EXPRESSLY SET OUT IN THESE TERMS OR ADDITIONAL TERMS, NEITHER BIOLAND NOR ITS SUPPLIERS OR DISTRIBUTORS MAKE ANY SPECIFIC PROMISES ABOUT THE SERVICES. FOR EXAMPLE, WE DON&rsquo;T MAKE ANY COMMITMENTS ABOUT THE CONTENT WITHIN THE SERVICES, THE SPECIFIC FUNCTIONS OF THE SERVICES, OR THEIR RELIABILITY, AVAILABILITY, OR ABILITY TO MEET YOUR NEEDS. WE PROVIDE THE SERVICES &ldquo;AS IS&rdquo;.<br />\r\nSOME JURISDICTIONS PROVIDE FOR CERTAIN WARRANTIES, LIKE THE IMPLIED WARRANTY OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NON-INFRINGEMENT. TO THE EXTENT PERMITTED BY LAW, WE EXCLUDE ALL WARRANTIES.<br />\r\n&nbsp;\r\n<h2>Copyright</h2>\r\nSoftware copyright is reserved by Bioland Technology Ltd..','2014-11-05 17:31:14'),('f9aa885b496f3add01497f4b5ba50001','9','&lsquo;X-Care&rsquo; designed by Bioland Technology Ltd. is one kind of App which allows users to take the measurement with Bioland Blood Pressure Monitor, Blood Glucose Monitor, Thermometer and Body Fat Scale devices to store data in private account on line. User may access the measurement data any time any place via Health Cloud Platform.&nbsp;&nbsp;<br />\r\n<br />\r\n&lsquo;X-Care&rsquo; saves users&rsquo; measurement results, all data sync&nbsp;to health cloud, form users&rsquo; health archives and generate tendency chart automatically, which can present users&rsquo; real records and allow families, doctors, friends to remote access the users&rsquo; measurement data after user&rsquo;s authorization. It is a perfect combination of hardware and services for personal healthcare aids.','2014-11-05 17:31:25');

